def minimum_tickets_to_achieve_contribution(n, prices, x, a, y, b, k):
    from math import gcd
    prices = [price // 100 for price in prices]
    z = x - y
    c = a * b // gcd(a, b)
    prices.sort(reverse=True)
    if x < y:
        (x, y, a, b) = (y, x, b, a)
    (l, r) = (-1, n + 1)
    while r - l > 1:
        m = (l + r) // 2
        w = m // c
        ans = 0
        for q in range(w):
            ans += prices[q] * z
        for q in range(w, m // a):
            ans += prices[q] * x
        for q in range(m // a, m // a + m // b - w):
            ans += prices[q] * y
        if ans >= k:
            r = m
        else:
            l = m
    if r == n + 1:
        return -1
    else:
        return r

